package br.unifesp.maritaca.business.answer.list.dto;

import java.util.ArrayList;
import java.util.Date;
import java.util.List;

/**
 * DTO used to retrieve all the answers for one form.
 * It is used mainly in the "List Answers" view.
 * @author tiagobarabasz
 */
public class AnswerListerDTO {
	
	private List<AnswerDTO> answers;	
	private List<String>    questions;	
	private String          formTitle;
	
	public List<AnswerDTO> getAnswers() {
		return answers;
	}
	
	public boolean isQuestionPicture(String question){
		return question.equals("Tire uma foto");
	}
	
	public String getAnswerLikeImage(String question, AnswerDTO answer){
		return "data:image/jpeg;base64,"+this.answerFromQuestion(question, answer);
	}
	
	public String answerFromQuestion(String question, AnswerDTO answer){
		for(int i=0; i<questions.size(); i++){
			if(questions.get(i).equals(question)){
				return answer.getAnswers().get(i);
			}
		}
		throw new RuntimeException();
	}

	public void setAnswers(List<AnswerDTO> answers) {
		this.answers = answers;
//		código chumbadaço para testar resposta
		AnswerDTO answer = new AnswerDTO();
		List<String> answersList = new ArrayList<String>();
		answersList.add("teste");
		answersList.add("teste");
		answersList.add("");
//		answersList.add("");
		answer.setAnswers(answersList);
		answer.setCollectDate(new Date());
		answer.setUserEmail("john@henrique.teixeira.godoi");
		this.answers.add(answer);
	}


	public List<String> getQuestions() {
		return questions;
	}


	public void setQuestions(List<String> questions) {
		this.questions = questions;
	}


	public String getFormTitle() {
		return formTitle;
	}


	public void setFormTitle(String formTitle) {
		this.formTitle = formTitle;
	}
		
}
